import React, { useState } from 'react'
import "./MultiplePriority.css";

const initialPriority = [
	{ name: "Gcash" },
	{ name: "DBP" },
	{ name: "Landbank" },
	{ name: "PayMaya" },
	{ name: "Total" },
  ];

const initialSections = [
  {title: "regular", counterno: "C1", ticketno: "A001"},
  {title: "senior", counterno: "C1", ticketno: "A001"},
  {title: "senior", counterno: "C1", ticketno: "A001"},	
  {title: "students", priority1:{counterno:"C1", ticketno:"B001"},priority2:{counterno:"C2", ticketno:"B002"}},
]

const MultiplePriority = (props) => {
	const [sections, setSections] = useState(initialSections);
	const [priorities, setPriorities] = useState(initialPriority);
  return (
   	<div className="PriorityContainer">
      {sections.map((section) => {
      	const partnComponents =  priorities.map((priority) => {
			return <p className="Content__partners"> {section.priority} </p>
		  });
		  return (
			<div>
			  {partnComponents}
			</div>
		  )
      })}
    </div>
  );
};



export default MultiplePriority;
